import React from "react";

const Footer = ()=>{

  return(
  <>
  
<div className="card text-bg-dark" style={{top:'450px',
height:'300px',marginTop:'50px',backgroundColor:'white' }}>
  <img src="images/panther.png" alt="" className="card-img" style={{objectFit:'cover'}}/>
  <div className="card-img-overlay">
    <h5 className="card-title" style={{color:'orange'}}>Card title</h5>
    <p className="card-text" style={{color:'orange'}}>Are you faster than panther to help ?</p>
    <p className="card-text"><small>Last updated 3 mins ago</small></p>
  </div>
</div>
  
  
  
  </>

  );


}
export default Footer
